function makeGuns (Gunlist = [], amount, TotalRotation, rotation, tankToIterate, PROPS = {}, delayChange){
 
  if (PROPS == null){
            PROPS = {
            SHOOT_SETTINGS: combineStats([g.basic]),
            TYPE: exports.bullet,
            LABEL: '',                  // def
            STAT_CALCULATOR: 0,         // def
            WAIT_TO_CYCLE: false,       // def
            AUTOFIRE: false,            // def
            SYNCS_SKILLS: false,        // def         
            MAX_CHILDREN: 0,            // def  
            ALT_FIRE: false,            // def 
            NEGATIVE_RECOIL: false,     // def
        } }
for (let i = 0; i < amount; i++) {
  tankToIterate.GUNS.push(
    {
      POSITION: [  Gunlist[0], Gunlist[1], Gunlist[2], Gunlist[3], Gunlist[4],  (i * (TotalRotation/amount)) + rotation,      0 + (i*delayChange),   ],
      PROPERTIES: PROPS
    }
  )
};
}

