function makeAuto(type, name = -1, options = {}) {
    let turret = { type: exports.autoTurret, size: 10, independent: true, };
    if (options.type != null) { turret.type = options.type; }
    if (options.size != null) { turret.size = options.size; }
    if (options.independent != null) { turret.independent = options.independent; }
    
    let output = JSON.parse(JSON.stringify(type));
    let autogun = {
        /*********  SIZE               X       Y     ANGLE    ARC */
        POSITION: [  turret.size,     0,      0,     180,    360,  1,], 
        TYPE: [turret.type, { CONTROLLERS: ['nearestDifferentMaster'], INDEPENDENT: turret.independent, }],
    };
    if (type.GUNS != null) { output.GUNS = type.GUNS; }
    if (type.TURRETS == null) { output.TURRETS = [autogun]; }
    else { output.TURRETS = [...type.TURRETS, autogun]; }
    if (name == -1) { output.LABEL = 'Auto-' + type.LABEL; } else { output.LABEL = name; }
    output.DANGER = type.DANGER + 1;
    return output;
}
function makeHybrid(type, name = -1) {
    let output = JSON.parse(JSON.stringify(type));
    let spawner = { 
        /********* LENGTH  WIDTH   ASPECT    X       Y     ANGLE   DELAY */
        POSITION: [   7,     12,    1.2,     8,      0,     180,     0,   ], 
        PROPERTIES: {
            SHOOT_SETTINGS: combineStats([g.drone, g.over]),
            TYPE: [exports.drone, { INDEPENDENT: true, }],
            AUTOFIRE: true,
            SYNCS_SKILLS: true,
            STAT_CALCULATOR: gunCalcNames.drone,
            WAIT_TO_CYCLE: false,    
            MAX_CHILDREN: 3,
        }, };
    if (type.TURRETS != null) { output.TURRETS = type.TURRETS; }
    if (type.GUNS == null) { output.GUNS = [spawner]; }
    else { output.GUNS = [...type.GUNS, spawner]; }
    if (name == -1) { output.LABEL = 'Hybrid ' + type.LABEL; } else { output.LABEL = name; }
    return output;
}
const makeFlank = (type, sides = 3, name = -1, options = {}) => {
    if (options.reload_delay == null) options.reload_delay = [];
    if (options.stats == null || options.stats === []) options.stats = [g.blank];
    if (options.angles == null) options.angles = [];
    let output = JSON.parse(JSON.stringify(type)),
        preGun = JSON.parse(JSON.stringify(type.GUNS)),
        aryGun = [];
    for (let i = 0; i < preGun.length; i++) if (options.angles[0] != undefined) preGun[i].POSITION[5] = options.angles[0];
    for (let i = 0; i < sides; i++) {
        for (let j = 0; j < preGun.length; j++) preGun[j].POSITION[6] = type.GUNS[j].POSITION[6] + (options.reload_delay[i] == undefined ? 0 : options.reload_delay[i]);
        aryGun.push(JSON.parse(JSON.stringify(preGun)));
        for (let j = 0; j < preGun.length; j++) preGun[j].POSITION[5] = options.angles[i + 1] == undefined ? preGun[j].POSITION[5] + 360 / sides : options.angles[i + 1];
    }
    output.GUNS = [];
    for (let i = 0; i < aryGun.length; i++) Array.prototype.push.apply(output.GUNS, aryGun[i]);
    for (let i = 0; i < output.GUNS.length; i++) try {
        let gun = output.GUNS[i].PROPERTIES.SHOOT_SETTINGS,
            stats = [[gun.reload, gun.recoil, gun.shudder, gun.size, gun.health, gun.damage, gun.pen, gun.speed, gun.maxSpeed, gun.range, gun.density, gun.spray, gun.resist], g.flank];
        for (let component of options.stats) stats.push(component);
        output.GUNS[i].PROPERTIES.SHOOT_SETTINGS = combineStats(stats);
        exports['makeFlank' + counters.flank] = output.GUNS[i].PROPERTIES.TYPE;
        output.GUNS[i].PROPERTIES.TYPE = exports['makeFlank' + counters.flank];
        counters.flank++;
    } catch (e) {}
    if (type.DANGER != null) output.DANGER = type.DANGER >= 7 ? type.DANGER : type.DANGER + 1;
    output.LABEL = name === -1 ? 'Flank ' + type.LABEL : name;
    return output;
};
