function makeX(num, tank, name) {
    let turret = tank
    let output = JSON.parse(JSON.stringify(exports.genericTank));
    output.TURRETS = []
    for (let i = 0; i < num; i++) {
      let autogun = {
        /*********  SIZE    X       Y     ANGLE    ARC */
        POSITION: [  11,     8,      0,     360/num * i,    360/num * 3,  0],
        TYPE: [turret, { CONTROLLERS: ['canRepel', 'onlyAcceptInArc', 'mapAltToFire', 'nearestDifferentMaster'], DANGER: -1, WAIT_TO_CYCLE: true,}],
      };
      output.TURRETS.push(autogun)
    } 
    output.LABEL = name || tank.LABEL + "-" + num;
    output.FACING_TYPE = "autospin";
    return output;
}
